import React from 'react'
import "./Support.css"
import {SupportType} from '../../../SignworksJSON'

export default function Support(props) {
    //console.log('props', props)
    const SBT = new SupportType();

    const getImage = () => {
        if (props.sel) {
          console.log('requrie', require("../../../styles/images/Supports/" + props.sel.attributes.SUPPORTTYPE + '.png'))
            return require("../../../styles/images/Supports/" + props.sel.attributes.SUPPORTTYPE + '.png')
        } else {
            return null;
        }
    }

    return (

        <div className="Support">
            <img src={getImage}/>
            <p>
                {props.sel
                    ? SBT.name(props.sel.attributes.SUPPORTTYPE, "SUPPORTTYPE")
                    : 'null '}
            </p>
        </div>
    )
}
